import React from 'react';
import { Col, Row } from 'antd';
import './productdetailpages.css';
import productData from '../../assets/data/product';

export const ProductDetailPages = () => {
  return (
    <Row>
      <Col span={10}>
        {
          productData.map((item, index) => (
            <div key={index}>
              <img src={item.img}/>
            </div>
          ))
        }
      </Col>
    </Row>
  )
}
